const colors0 = {
    blued: '#113f67',
    bluel: '#38598b',
    purplec: '#a2a8d3',
    mist: '#e7eaf6'
};

const colors1 = {
    blued: '#5585b5',
    verdigris: '#53a8b6',
    blueh: '#79c2d0',
    icej: '#bbe4e9'
}

export default { colors0, colors1 };
